import React from 'react';
import './App.css';
import Person from './Person/Person';

function App() {
  return (
    <div className="App">
      <h1>Hi, I'm a React App!</h1>
      <Person name="Waqar" age="25" />
      <Person name="Rizwan" age="23" />
      <Person name="Umar" age="28" />
    </div>
  );
}

export default App;
